import { PDFDocument, rgb } from 'npm:pdf-lib'
import type { PDFPage } from 'npm:pdf-lib'
import { format } from 'npm:date-fns'
import { TransportData } from './db.ts'


export async function drawBackgroundWaybill(page: PDFPage, pdfDoc: PDFDocument) {
    const waybillImage = await pdfDoc.embedPng(Uint8Array.from(atob(base64Image), c => c.charCodeAt(0)))

    page.drawImage(waybillImage, {
        x: 0,
        y: 0,
        width: page.getWidth(),
        height: page.getHeight(),
    })
}

export function drawData(page: PDFPage, transportData: TransportData) {
    drawConsignorClassification(page, transportData.goods.consignor_classification);
    drawConsignee(page, transportData);
    drawParty(110, 755, page, transportData.consignor);
    drawParty(110, 640, page, transportData.pickup_party);
    drawParty(380, 640, page, transportData.pickup_location);
    drawParty(390, 575, page, transportData.delivery_location);
    drawDate(page, new Date(), 399, 602);
    drawDate(page, new Date(), 400, 537);
    drawLicensePlate(page, transportData.transport.truck_id);
    drawDetails(page);
    drawWaste(page, transportData.goods);
}

function drawConsignorClassification(page: PDFPage, consignorClassification: number) {
    let x = 0;
    const y = 768;
    switch (consignorClassification) {
        case 1:
            x = 60;
            break;
        case 2:
            x = 113;
            break;
        case 3:
            x = 168;
            break;
        case 4:
            x = 222;
            break;
        default:
            break;
    }


    page.drawText('x', {
        x: x,
        y: y,
        size: 12,
        color: rgb(0, 0, 0)
    })
}

function drawConsignee(page: PDFPage, transportData: TransportData) {
    let x = 0;
    const y = 510;

    if (transportData.carrier_party.id === transportData.consignor.id) {
        x = 134;
    } else if (transportData.carrier_party.id === transportData.pickup_party.id) {
        x = 187;
    }
    else if (transportData.carrier_party.id === transportData.consignee.id) {
        x = 242;
        drawParty(125, 500, page, transportData.consignee);
        drawCarrierVihb(page, transportData.consignee.vihb_id);
    }
    else {
        x = 404;
        drawParty(125, 500, page, transportData.consignee);
        drawParty(125, 575, page, transportData.carrier_party);
        drawCarrierVihb(page, transportData.consignee.vihb_id);
    }

    page.drawText('x', {
        x: x,
        y: y,
        size: 12,
        color: rgb(0, 0, 0)
    })
}

function drawParty(
    x: number,
    y: number,
    page: PDFPage,
    party: { name?: string; postalCode?: string; city?: string; vihb?: string; street_name?: string; building_number?: string; postal_code?: string; vihb_id?: string; }) {

    const name = party?.name || '';
    page.drawText(name, {
        x,
        y,
        size: 10,
        color: rgb(0, 0, 0)
    });

    const address = (party.street_name && party.building_number) ?
        `${party.street_name?.substring(0, 36)} ${party.building_number}` :
        '';
    page.drawText(address, {
        x: x,
        y: y - 13,
        size: 10,
        color: rgb(0, 0, 0)
    });

    const postalCode = party.postal_code || party.postalCode || '';
    const city = party.city || '';
    page.drawText(`${postalCode} ${city}`, {
        x: x,
        y: y - 26,
        size: 10,
        color: rgb(0, 0, 0)
    });

    const vihbText = party.vihb_id || party.vihb || '';
    if (vihbText) {
        page.drawText(vihbText, {
            x: x,
            y: y - 39,
            size: 10,
            color: rgb(0, 0, 0)
        });
    }
}

function drawDate(page: PDFPage, date: Date, x: number, y: number) {
    page.drawText(format(date, 'dd-MM-yyyy'), {
        x,
        y,
        size: 10,
        color: rgb(0, 0, 0)
    });
}

function drawLicensePlate(page: PDFPage, licensePlate?: string) {
    {
        page.drawText(licensePlate ? licensePlate : '-', {
            x: 350,
            y: 475,
            size: 10,
            color: rgb(0, 0, 0)
        });
    }
}

function drawCarrierVihb(page: PDFPage, vihb?: string) {
    {
        page.drawText(vihb ? vihb : '-', {
            x: 365,
            y: 500,
            size: 10,
            color: rgb(0, 0, 0)
        });
    }
}

function drawDetails(page: PDFPage) {
    page.drawText('x', {
        x: 547,
        y: 512,
        size: 12,
        color: rgb(0, 0, 0)
    })
    page.drawText('x', {
        x: 547,
        y: 485,
        size: 12,
        color: rgb(0, 0, 0)
    })
    page.drawText('x', {
        x: 547,
        y: 472,
        size: 12,
        color: rgb(0, 0, 0)
    })
}

function drawWaste(page: PDFPage, goods: {
    name: string;
    quantity: number;
    unit: string;
    net_net_weight: number;
    waste_stream_number: string;
    eural_code: string;
    processing_method_code: string;
    consignor_classification: number;
}) {

    goods.waste_stream_number && page.drawText(goods.waste_stream_number, {
        x: 60,
        y: 410,
        size: 10,
        color: rgb(0, 0, 0)
    })

    page.drawText(goods.name, {
        x: 150,
        y: 410,
        size: 10,
        color: rgb(0, 0, 0)
    })

    page.drawText(goods.quantity.toString(), {
        x: 355,
        y: 410,
        size: 10,
        color: rgb(0, 0, 0)
    })

    page.drawText(goods.eural_code, {
        x: 405,
        y: 410,
        size: 8,
        color: rgb(0, 0, 0)
    })

    page.drawText(goods.processing_method_code, {
        x: 458,
        y: 410,
        size: 8,
        color: rgb(0, 0, 0)
    })

    page.drawText(goods.net_net_weight.toString(), {
        x: 485,
        y: 410,
        size: 10,
        color: rgb(0, 0, 0)
    })
}

/**
 * Extracts base64 data from a data URL string
 * @param dataUrl Data URL in format data:image/png;base64,{base64data}
 * @returns Base64 data without the prefix
 */
function extractBase64FromDataUrl(dataUrl?: string): string | null {
    if (!dataUrl) return null;

    const matches = dataUrl.match(/^data:image\/(png|jpeg|jpg|gif);base64,(.+)$/);
    return matches && matches.length >= 3 ? matches[2] : null;
}

